import React, { Component } from 'react';
const Checkboxinput = props => (
    <input id="1" type="checkbox" name="SvenBrand1985" value="SvenBrand1985" {...props} />
  )
const Checkbox = (props) => 
{


    state = { checked: true }
        let chekbox = [];
        for (let i=0; i <= 0; i++)
        {
            chekbox.push(
                <div className="col-md-3">
                <div className={["custom-checkbox " + props.class]}>
                <Checkboxinput  checked={props.checked} onChange={props.changes} />
                        <label for="1">Enabled Unselected</label>
                  </div>
           </div>  
            )
        }
        return (
           <>
             {chekbox}
           </>
        );
}


export default Checkbox;
